import React, {Component} from 'react'

class Header extends Component
{
    render(){
        const styles = {
            headerDefault: {
                align : 'center'
            },
            divDefault:{
                backgroundColor : 'tomato',
                textAlign : 'center',
                color     : 'blue'
            },
            inputDefault:{
                backgroundColor : 'black',
                textAlign : 'center',
                color   : 'yellow',
                align   : 'center'
            }
        }


        return(
            <header style={styles.headerDefault}>
                <div style={styles.divDefault}>
                    Logo
                </div>
                <input type="text" style={styles.inputDefault}/>
            </header>
        )
    }

}


export default Header;


